SELECT ng_rest.create_company('ng_adventuresyndicate', json_build_object(
    'delete_if_exists', 'true',
    'tables', json_build_object(
        'json_store', json_build_object(
                'constraints', json_build_array(
                    json_build_object(
                        'name', 'json_store_pk',
                        'value', 'PRIMARY KEY (id)'
                    )
                )
        ),
        'binary_store', json_build_object(
            'constraints', json_build_array(
                json_build_object(
                    'name', 'binary_store_pk',
                    'value', 'PRIMARY KEY (binary_id)'
                )
            )
        ),
        'acl', json_build_object(
            'constraints', json_build_array(
                json_build_object('name', 'acl_pkey', 'value', 'PRIMARY KEY (acl_id)')
            )
        )
)));

--This is used to stop the same message being inserted multiple times
CREATE UNIQUE INDEX spot_tracker_id_idx ON ng_adventuresyndicate.features  ((attributes ->> 'message_id'));

--Create an api user
SELECT ng_rest.create_user('ng_adventuresyndicate',
                           json_build_object('user_active', TRUE, 'user_name', 'as_api_user', 'user_email',
                                             'adventuresynidcate@nautoguide.com', 'user_password',
                                             '4e8169cdef254d22eb3f171b2c12b66c9d3914ae', 'user_type', 'registered'));

--Create a registered user type
INSERT INTO ng_adventuresyndicate.user_type(user_type_name) VALUES('registered');

--Set a token and allow access for five years
UPDATE ng_adventuresyndicate.users
SET current_token = 'QW123RT6Y',
    current_token_expiry = now() + INTERVAL '5 years',
    user_type_id = (SELECT user_type_id FROM ng_adventuresyndicate.user_type WHERE user_type_name = 'registered');


--Create some acls
INSERT INTO  ng_adventuresyndicate.acl (user_type_id, methods, actions, schema, allow, layers, pages, app_name, security)
VALUES (
    (SELECT user_type_id FROM  ng_adventuresyndicate.user_type WHERE user_type_name = 'registered'),
    '{
      "configuration_api": {
        "actions": {
          "token_check": {}
        }
      },
      "feature_api": {
        "actions": [
          "get_geojson",
          "add_feature",
          "update"
        ]
      },
      "search_api": {
        "actions": [
          "search"
        ]
      },
      "reporting_api": {
        "actions": [
          "run_report"
        ]
      },
      "session": {
        "actions": [
          "change"
        ]
      }
    }'::JSON,
    NULL,
    'ng_adventuresyndicate',
    TRUE,
    ARRAY['*'],
    ARRAY['default','help','impImages'],
    'map_tracker',
    '{}'::JSON
);


